import React from 'react';
import styled from 'styled-components';
import { ell } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Button = styled.button`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  margin: 0 50px;
  border: none;
  background: #ccc;
`;

const Navigation = () => <FontAwesomeIcon icon={faTimes} />;

export default Navigation;
